import { AppBar, Typography } from "@mui/material";
import React from "react";
import { useStyles } from "./style";


const Header = (props)=>{

  const s = useStyles()

  return(
    <AppBar className={s.header}>
      <Typography variant='h3' className={s.logo} >neeva</Typography>
    </AppBar>
  )
}

export default Header;
